function ProjectCard({project}) {
  return (
    <div>
        <img src={project.image.stringValue} alt={project.title.stringValue} />
        <h3>{project.title.stringValue}</h3>
        <a href={project.lienGitHub.stringValue} target="_blank" rel="noreferrer">
          Repository
        </a>
    </div>
  );
}

export default ProjectCard;
